
var request = require('supertest');
var expect = require('chai').expect;

module.exports = function(db){

    var User = db.model('User');
    var Image = db.model('Image');

    var host = process.env.HOST;
    var agent = request.agent(host);

    var user1 = {
        fbId: 'testImage1',
        pushToken: "image125478963",
        os: 'APPLE',
        coordinates: [23, 77]
    };

    var avatar = {
        image: ""
    };

    var photoGallery1 = {
        image: ""
    };

    var photoGallery2 = {
        image: ""
    };

    var uId;
    var imageName;

    describe('Test image', function(){

        it('SignIn User', function(done){

            var url = '/signIn';

            agent
                .post(url)
                .send(user1)
                .end(function (err, res) {

                    if (err) {
                        return done(err);
                    }

                    expect(res.status).to.equals(200);

                    User
                        .findOne({fbId: user1.fbId}, function(err, resUser){

                            if (err){
                                return done(err);
                            }

                            uId = resUser._id;

                            done(null);

                        });


                });

        });

        it('Upload Avatar', function(done){

            var url = '/image/avatar';

            agent
                .post(url)
                .send(avatar)
                .end(function(err, res){

                    if (err){
                        return done(err);
                    }

                    expect(res.status).to.equals(200);

                    Image
                        .findOne({user: uId}, function(err, resImage){

                            if (err){
                                return done(err);
                            }

                            expect(resImage).to.instanceOf(Object);
                            expect(typeof resImage.avatar).to.equals('string');

                            done(null);

                        });

                });

        });

        it('Get Avatar', function(done){

            var url = '/image/avatar';
            var body;

            agent
                .get(url)
                .end(function(err, res){

                    if (err){
                        return done(err);
                    }

                    body = res.body;

                    expect(res.status).to.equals(200);
                    expect(body).to.instanceOf(Object);
                    expect(Object.keys(body)).to.instanceOf(Array);
                    expect(Object.keys(body)[0]).to.equals('url');

                    done(null);


                });

        });

        it('Delete avatar', function(done){

            var url = '/image/avatar';
            var avatarImage;

            agent
                .delete(url)
                .end(function(err, res){

                    if (err){
                        return done(err);
                    }

                    expect(res.status).to.equals(200);

                    Image
                        .findOne({user: uId}, function(err, resUser){

                            if (err){
                                return done(err);
                            }

                            avatarImage = resUser.avatar;

                            expect(avatarImage).to.equals('');

                            done(null);

                        });

                });

        });

        it('Get Empty Avatar', function(done){

            var url = '/image/avatar';
            var body;

            agent
                .get(url)
                .end(function(err, res){

                    if (err){
                        return done(err);
                    }

                    body = res.body;

                    expect(res.status).to.equals(404);

                    done(null);


                });

        });

        it('Upload gallery photo1', function(done){

            var url = '/image/photo';
            var images;

            agent
                .post(url)
                .send(photoGallery1)
                .expect(200, function(err){

                    if (err){
                        return done(err);
                    }

                    Image
                        .findOne({user: uId}, function(err, resUser){

                            if (err){
                                return done(err);
                            }

                            images = resUser.gallery;

                            imageName = images[0];

                            expect(images).to.instanceOf(Array);
                            expect(images.length).to.equals(1);
                            expect(typeof (images[0])).to.equals('string');
                            done(null);
                        });

                });

        });

        it('Upload gallery photo2', function(done){

            var url = '/image/photo';
            var images;

            agent
                .post(url)
                .send(photoGallery2)
                .expect(200, function(err){

                    if (err){
                        return done(err);
                    }

                    Image
                        .findOne({user: uId}, function(err, resUser){

                            if (err){
                                return done(err);
                            }

                            images = resUser.gallery;

                            expect(images).to.instanceOf(Array);
                            expect(images.length).to.equals(2);
                            expect(typeof (images[0])).to.equals('string');
                            expect(typeof (images[1])).to.equals('string');
                            done(null);
                        });

                });

        });

        it('Get image urls list', function(done){

            var url = '/image/photo';
            var body;

            agent
                .get(url)
                .expect(200, function(err, res){

                    if (err){
                        return done(err);
                    }

                    body = res.body;

                    expect(body).to.instanceOf(Object);
                    expect(Object.keys(body)[0]).to.equals('urls');
                    expect(body.urls).to.instanceOf(Array);
                    expect(body.urls.length).to.equals(2);

                    done(null);

                });
        });

        it('Delete image from gallery', function(done){

            var url = '/image/photo';
            var deleteObj = {};
            deleteObj['image'] = imageName;


            agent
                .delete(url)
                .send(deleteObj)
                .expect(200, function(err){

                    if (err){
                        return done(err);
                    }

                    done(null);
                });

        });

        it('Delete User', function(done){

            var url = '/users';

            agent
                .delete(url)
                .expect(200, function(err){

                    if (err){
                        return done(err);
                    }

                    done(null);

                });

        });

    });

};